function Card(props){
    return(
    
      <div className="cards">
      <div className="card">
        <img  src={props.imgsrc} alt="mypic" className="card_img" style={{width:"20.0rem",height:"20.0rem"}}/>   
      <div className="card_info" >
          <span className="card_category">{props.titile}</span>
          <h3 className="card_title">{props.categ}</h3>
      <a href={props.link}  target="_blank">
            <button>Watch Now</button>
      </a>
          
          </div>
      </div>
    
    </div>
    
    );
  }

  export default Card
